import React from "react";

import Header from "../Components/Header";
import SubPortfolioInfo from "../UI/SubPortfolioInfo";
import Footer from "../Components/Footer";

import "../fonts/fonts.css";
import classes from "./Compose.module.css";
import classes2 from "./Nespresso.module.css";

const JejuDrink = () => {
  return (
    <div
      style={{
        width: "100%",
        maxWidth: "1920px",
        margin: "0 auto",
        position: "relative",
      }}
    >
      <Header bgColor=" " titleColor="#ffffff" />

      <div
        className={classes2.subPageBanner}
        style={{
          background: "url(images/sub_jeju_info_banner.png)",
          width: "100%",
          height: "980px",
          margin: "0 auto",
        }}
      >
        <SubPortfolioInfo
          portfolioInfo="#fff"
          peroid="2021.09 ~ 2021.10"
          percent="100%"
          PS=""
          AI="true"
          XD=""
          HTML=""
          CSS=""
          JS=""
        />
      </div>

      <section className={classes2.subInfo} style={{ background: "#fff" }}>
        <div className={classes2.subInfoContent}>
          <div
            className={classes2.infoTitle}
            style={{ margin: "0 auto", paddingTop: "180px" }}
          >
            <p
              style={{ textAlign: "center", marginTop: "38px", color: "#fff" }}
            >
              네스프레소는 1980년대 유럽시장에서 처음 소개된 '네슬레'의 캡슐커피
              브랜드입니다.
              <br />
              현재 캡슐의 특허가 만료되어 다양한 브랜드에서 호환캡슐이 출시되고
              있습니다.
            </p>
          </div>
        </div>
      </section>

      <Footer footerBottom="0" />
    </div>
  );
};

export default JejuDrink;
